import React, { useEffect, useState } from 'react';
import axios from 'axios';
import EmployeeProfile from './EmployeeProfile';
import { Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Avatar, Typography, TextField, Button, Box, Tooltip } from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import SearchIcon from '@mui/icons-material/Search';

function EmployeeList() {
  const [profileOpen, setProfileOpen] = useState(false);
  const [selectedEmployee, setSelectedEmployee] = useState(null);

  // Accept onBack prop for navigation
  const props = arguments[0] || {};
  const onBack = props.onBack;
  const showProfile = (emp) => {
    setSelectedEmployee(emp);
    setProfileOpen(true);
  };
  const handleProfileClose = () => {
    setProfileOpen(false);
    setSelectedEmployee(null);
  };
  const handleProfileUpdate = () => {
    setProfileOpen(false);
    setSelectedEmployee(null);
    // Refresh employee list after update
    setLoading(true);
    axios.get('http://localhost:5000/api/employees')
      .then(res => {
        setEmployees(res.data);
        setLoading(false);
      })
      .catch(err => {
        setError('Failed to fetch employees');
        setLoading(false);
      });
  };
  const [employees, setEmployees] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [search, setSearch] = useState('');

  useEffect(() => {
    axios.get('http://localhost:5000/api/employees')
      .then(res => {
        setEmployees(res.data);
        setLoading(false);
      })
      .catch(err => {
        setError('Failed to fetch employees');
        setLoading(false);
      });
  }, []);

  if (loading) return <Typography align="center" sx={{ mt: 4 }}>Loading employees...</Typography>;
  if (error) return <Typography color="error" align="center" sx={{ mt: 4 }}>{error}</Typography>;

  // Filter employees by NIC number only
  const filtered = employees.filter(emp =>
    emp.nicNumber.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <Box sx={{ width: '100vw', height: '100vh', minHeight: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', background: 'linear-gradient(135deg, #e3f2fd 60%, #fff 100%)', overflow: 'hidden' }}>
      <Paper elevation={6} sx={{ width: '90vw', maxWidth: 1700, p: 5, borderRadius: 4, boxShadow: 8, maxHeight: '90vh', overflowY: 'auto' }}>
      <Typography variant="h5" align="center" sx={{ color: '#1976d2', fontWeight: 700, mb: 3, letterSpacing: 1 }}>Employee List</Typography>
      <Box display="flex" justifyContent="center" alignItems="center" mb={3}>
        <TextField
          variant="outlined"
          placeholder="Search by NIC number"
          value={search}
          onChange={e => setSearch(e.target.value)}
          InputProps={{
            startAdornment: (
              <SearchIcon color="primary" sx={{ mr: 1 }} />
            ),
            sx: { borderRadius: 3, background: '#fff' }
          }}
          sx={{ width: 340 }}
        />
      </Box>
      {filtered.length === 0 ? (
        <Typography align="center" color="text.secondary">No employees found.</Typography>
      ) : (
        <TableContainer component={Paper} sx={{ borderRadius: 3, boxShadow: 3, width: '100%' }}>
          {/* Make table fill the container */}
          <Table sx={{ minWidth: 1200, width: '100%' }}>
            <TableHead sx={{ background: 'linear-gradient(90deg, #1976d2 60%, #42a5f5 100%)' }}>
              <TableRow>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Photo</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Full Name</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>NIC Number</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Date of Birth</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Age</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Sex</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>District</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Permanent Address</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Temporary Address</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Contact Details</TableCell>
                <TableCell sx={{ color: '#fff', fontWeight: 700, fontSize: 20, py: 2 }}>Profile</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filtered.map(emp => (
                <TableRow key={emp._id} hover sx={{ background: '#f8fafc', fontSize: 18, height: 72 }}>
                  <TableCell>
                    {emp.photo ? (
                      <Avatar src={`data:image/*;base64,${emp.photo}`} alt={emp.fullName} sx={{ width: 64, height: 64, mx: 'auto', border: '2px solid #1976d2' }} />
                    ) : (
                      <Avatar sx={{ width: 64, height: 64, mx: 'auto', bgcolor: '#bdbdbd' }}>
                        <PersonIcon sx={{ fontSize: 36 }} />
                      </Avatar>
                    )}
                  </TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.fullName}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.nicNumber}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{new Date(emp.dateOfBirth).toLocaleDateString()}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.age}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.sex}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.district}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.permanentAddress}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.temporaryAddress}</TableCell>
                  <TableCell sx={{ fontSize: 18 }}>{emp.contactDetails}</TableCell>
                  <TableCell>
                    {!profileOpen && (
                      <Tooltip title="Show Profile" arrow>
                        <Button
                          variant="contained"
                          color="primary"
                          size="large"
                          sx={{ borderRadius: 2, fontWeight: 600, px: 2, letterSpacing: 1, fontSize: 16 }}
                          onClick={() => showProfile(emp)}
                        >
                          Profile
                        </Button>
                      </Tooltip>
                    )}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
      <EmployeeProfile
        open={profileOpen}
        onClose={handleProfileClose}
        employee={selectedEmployee}
        onUpdate={handleProfileUpdate}
      />
      {onBack && (
        <Button
          onClick={onBack}
          variant="contained"
          color="secondary"
          size="large"
          sx={{
            marginTop: 4,
            borderRadius: 3,
            px: 4,
            py: 1.5,
            fontWeight: 600,
            fontSize: 18,
            letterSpacing: 1,
            boxShadow: '0 2px 8px #b3c6e0',
            display: 'block',
            mx: 'auto'
          }}
        >
          ‚Üê Home
        </Button>
      )}
      </Paper>
    </Box>
  );
}

export default EmployeeList;
